import React from "react";
import pic from "./images/img.png";
import "./App.css";
import Todo from "./Todo";
import Timer from "./Timer";
import WorkTodo from "./WorkTodo";
import Footer from "./Footer";
const App = () => {
    const inputEvent = () => {};
  const inputList = () => {};
    return (
        <>
            <div className="main_div">
                <div className="part1">
                    <div className="img">
                        <img className="imgstyle" src={pic} alt="pic" />
                    </div>
                    <div className="logo">
                        <h1>Task-List</h1>
                    </div>
                    <div className="timer">
                        <Timer />
                    </div>
                    <div className="Mid_section"></div>
                </div>
                <div className="mid_content">
                    <div className="todolist">
                        <div className="main_container">
                            <div className="top_head">
                                <div className="header">
                                    <h1>Today's Routine!</h1>
                                </div>
                                <div className="dayAndDate">
                                    <span className="day">Day of the week</span>
                                    <span className="date">date of the Month</span>

                                </div>
                            </div>

                            <div className="input_feild">
                                <input className="input_section"
                                    type="text"
                                    placeholder="Add a Task"
                                    onChange={inputEvent}
                                    value={inputList}
                                />
                                <div className="btn_style">
                                    {/* <img src={Add} alt="pic2" /> */}
                                </div>

                            </div>

                        </div>
                    </div>
                    <div className="result">
                        <WorkTodo />
                    </div>
                </div>
                <div className="footer">
                    <Footer />
                </div>
            </div>
        </>
    );
};
export default App;
